import React from 'react';
import './App.css';
import Form from "./components/Form";

class App extends Components {
  getRecipe() {
    console.log("Working!!");
  }
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <h1 className="App-title">Recipe-Search</h1>
        </header>
        <Form getRecipe={this.getRecipe} />
      </div>
    );
  }
}

export default App;
